INSERT INTO `user` VALUES ('3rdworld','073cdf44e4a62f9158f448aec45b2db2',144066526,0,13,0,'faction','Swords of Kentares',0,1,0,'2013-11-28 06:48:16','2013-11-27 19:04:54','','3rdworlds@gmail.com'),('antares','c849840b980ddb21fcf4ce0c257ce931',7871803,0,2,1,'clan','Antares Scorpions',0,1,12,'2013-11-27 15:39:31','2013-11-27 15:39:31','Antares Scorpions Teamspeak: <a href=\"#\">antares-scorpions.typefrag.com</a><br><br>Contacts:<br><a href=\"http://mwomercs.com/forums/user/445093-pisceszero/\">Piceszero</a><br><a href=\"http://mwomercs.com/forums/user/362335-avatarofwhat/\">AvatarOfWhat</a><br><br><img src=\"http://antaresscorpions.co.uk/wp-content/uploads/2012/09/dredd.jpg\" />','multitallented@gmail.com'),('aylward','831b62fe88bbb10333c4b5dcd47119fd',211644840,0,2,4,'faction','1st HeadHunters of Davion RCT',0,1,0,'2013-11-28 07:28:35','2013-11-28 04:43:14','<img src=\"http://files.enjin.com/249013/site_logo/avatar.png\" /><br><br><b>Contact Gen. Aylward for info or scheduling (aylward@hhod.com) </b><br><br>Find us on the House Davion general TS server:  50.22.145.232:7345<br><i>under the section \"1st Headhunters of Davion RCT\"</i><br><br>Our Website:  <a href=\"http://mwo.enjin.com\">www.hhod.com</a>','aylward@hhod.com'),('blackstoneknights','6da495ccce6077d4ef935fbb4e3f548f',30841998,0,2,0,'merc','Blackstone Knights',0,1,0,'2013-11-27 05:00:50','2013-11-27 05:00:50','We accept the following contracts:<br>http://www.blackstoneknights.org/contracts/','bskcommand@gmail.com'),('blackwindlancers','c9297f7510fed1ee3572e38dbd817ea5',57373128,0,4,0,'faction','Black Wind Lancers',0,1,0,'2013-11-28 07:47:05','2013-11-28 03:28:56','','2ndlegion@228ibr.com'),('bongfu','482e91f2f2c88178631c42c5ddb417b7',697445298,0,0,2,'clan','Clan Diamond Shark',0,1,0,'2013-11-11 06:16:59','2013-11-11 03:57:21','','bongfu@gmail.com'),('canuck307','7e7316c9c362f3ae26e84bf9194473d2',35984613,0,0,2,'merc','Luna Wolves',0,1,0,'2013-11-20 02:19:36','2013-11-20 02:19:36','Contacts:<br><br>Zaharial: Lt. (Drop commander)<br><br>http://mwomercs.com/forums/user/145538-zahariel/<br><br>http://lunawolves.enjin.com/profile/6035380<br><br>Canuck: Major<br><br>http://mwomercs.com/forums/user/249645-canuck307/<br><br>http://lunawolves.enjin.com/profile/3133032<br><br><br>',''),('cef command','22588bf8d5eaff86f0eda0287677c9e2',45020724,0,1,3,'pirate','Canadian Expeditionary Force',0,1,0,'2013-11-28 15:57:36','2013-11-28 12:19:54','CEF TeamSpeak contact;<br><br>ts.cefmwo.com<br><br>PW: Guest','command.cefmwo@gmail.com'),('crazyhorse','d428d6d72f8cdfd888c64eb915f101dc',144987189,0,3,1,'merc','Red Shadows',0,1,0,'2013-11-28 15:08:31','2013-11-28 06:44:04','<img src=\"http://imageshack.us/a/img33/7926/g2ne.png\" /><br><br>In the day to day depravity of war there are many situations that need to be <br>handled as quickly as possible: Insurgences, merchandise shortages, <br>battlefield turntables... we know the trouble war can be for any experienced <br>commander when your roster is better with the beer and the darts than with <br>war tactics.<br><br>The Red Shadows Merc Unit offers solutions for almost all and every problem <br>you may find at work. You name it, we make it. Either a surgical operation to <br>control a single block, or a full door blast to make a garrison think about it <br>twice before keeping a position, we can do the job. <br><br>Have your forces spread out a bit too much across your battlefront? <br>No worries. We\'ll maintain the things in place until you arrive with a flag and <br>take control of the situation. Everything at a reasonable price, of course.<br>Don\'t hesitate to contact us for your military needs. <br><br>Red Shadows Merc. Unit: We are big, we are ugly, and we are affordable.<br><br><br>',''),('dankith','92363d749a16dc9ffd596c26e708d3fd',293028195,0,1,2,'faction','Carrion Crows',0,1,0,'2013-11-28 03:32:16','2013-11-28 03:32:16','','kosim.artur@gmail.com'),('deadfire','6da8da7f1a0b5a9972a736afe51424f7',281354637,0,9,0,'pirate','228th Inde