ear the EAGLE!!!!<br><br>','nexon420@gmail.com'),('kwea','88566ff2a94498968ac708374fe41297',4151943,0,0,1,'merc','4th Highland Guard',0,1,0,'2013-11-28 09:32:29','2013-11-28 09:32:29','','brilljr@hotmail.com'),('longbowman','250ec636954ff89bf82f0f597ec81795',1058750000,0,0,0,'faction','1FSAC',0,1,0,'2013-11-27 14:56:08','2013-11-27 14:56:08','','nathor2112@msn.com'),('m4rti','b2b32a068b91f3672061e4a4d1b34899',39778451,0,0,0,'merc','25th Skye Rangers',0,1,0,'2013-11-28 07:48:54','2013-11-28 07:48:54','','a.marterer@live.de'),('mech79','c977c0cb1b0a8cc1e069235a504dd892',12459500,0,0,1,'merc','Crimson Death Commandos',0,1,0,'2013-11-28 04:54:29','2013-11-27 05:05:53','','rylandb79@yahoo.com'),('multitallented','d1678b77a1e66888d5e6d01c388afb63',1298698027,1,0,0,'admin','ComStar',0,1,0,'2013-11-28 16:05:41','2013-11-28 04:53:56','I am the admin of this league and I am also a member of KaoS Legion. I have years of experience with being an admin in an exploit/bug rich environment.<br><br>I am a very relaxed, patient guy and I run the league in the same way. I try to fix things as quickly as possible and be as helpful as I can.<br><br>My primary concern is the success of Mechwarrior Online, and I hope that this league helps in that way.','multitallented@pacbell.net'),('ngng','7ed596da521c2586e5a6b4f677946bab',15000000,1,0,0,'admin','NGNG',0,1,0,'2013-10-30 23:09:25','2013-10-30 02:49:09','','bombadil@nogutsnogalaxy.net'),('queenblade','afa6a3ed549bd4ab63ed28da062f6094',135000000,1,0,0,'admin','ComStar',0,1,0,'2013-11-28 00:58:35','2013-11-27 04:08:32',NULL,NULL),('shadowwolf jerricho','e30079d3181e8a0feca7c62dcfce1e8b',150462188,0,0,0,'merc','Kell Hounds',0,1,0,'2013-11-28 04:43:44','2013-11-28 04:43:44','<a href=\"http://kellhounds.net/\">Kell Hounds Site</a><br><br><a href=\"http://kellhounds.net/diplomat-application/\">Diplomat Application Form</a><br><br><img src=\"http://i.imgur.com/voKEQUX.png\" /><br><br>The Kell Hounds have gathered together a group of gamers for the purpose of more than just gaming, but to establish lasting friendships since 2005. A mercenary unit with a conscience, the Kell Hounds have been devoted to the Mechwarrior and Battletech universes playing every variation the games that have come to fruition. We are always looking for mature and fun loving gamers to fill our ranks. In Mechwarrior Online we are playing as the Shadow Hounds until we may prove ourselves to acquire the Kell Hounds title in the game.','shadowwolf_jerricho@hotmail.com'),('talkpolite','c7e6c04d53cd999bd049b75a723ceb7e',129931076,0,1,0,'pirate','Swords of Davion',0,1,0,'2013-11-28 09:56:26','2013-11-27 23:55:15','<a href=\"http://tinypic.com?ref=2qv46ex\" target=\"_blank\"><img src=\"http://i41.tinypic.com/2qv46ex.jpg\" border=\"0\" alt=\"Image and video hosting by TinyPic\"></a><br><br>The Swords of Davion represent members of the 1st Head Hunters of Davions 5th Battalion. Reformed only a few short months ago, The SoD strives for victory in any way possible if they pay is right and the salvage is good. <br><br>MAJ Talk \"Firetide\" Polite<br>CPT Big STRETCH<br><br>LT. LpMagic<br>1st Company \"The Razors Edge\" - Dropship \"The Bearded Lady\"<br><br>LT XFactor76<br>2nd Company \"Kilroys Legion\" - Dropship \"Commando Orgy House\"<br><br>LT Kyle Wright<br>3rd Company \"The Dirty Dozen\" - Dropship \"Babylon 5\"<br><br>Contact us on the general Davion server: 50.22.145.232:7345','lpena2@zagmail.gonzaga.edu'),('vas79','5ddbce6b034c842c7d86a5ac82a5b7d3',136142937,0,5,4,'pirate','Apocalypse Lancers',0,1,0,'2013-11-28 13:01:45','2013-11-28 13:01:45','','b.crowston@hotmail.com'),('will hellfire','2f3ed7b267ac96580d8de6844958d43e',110154798,0,1,0,'merc','Ronin Legion',0,1,0,'2013-11-28 16:04:19','2013-11-27 21:22:37','<img src=\"http://img827.imageshack.us/img827/2617/lc9w.jpg\" />','williamfogg@gmail.com');
